import React from 'react';
import { AppBar, Box, CssBaseline,  makeStyles, Toolbar, Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    boxShadow:"#e05929",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

const Header = () =>{
    //#e05929;
    const classes = useStyles();
    return(
        <div className={classes.root}>
            <CssBaseline/>
            <AppBar positon="static" color="#fff">
                <Toolbar>
                    <Typography variant="h6">
                        HCA Healthcare Video Library
                    </Typography>
                </Toolbar>
            </AppBar>
        </div>


    );

}
export default Header;
